import React from "react";
import "./table.css";

const Genericpage = ({
    pageName,
    tableHeaderComponent,
    tableInfoComponent,
    editButtonComponent,
    // deleteButtonComponent,
    // createButtonComponent,
}) => {
    return (
        <section>
            <h2>{pageName}</h2>
            <table className="dataTable">
                <thead>
                    <tr className="tableHeader">{tableHeaderComponent}</tr>
                    <tr>
                        <th>Action</th>
                    </tr>
                </thead>
                <tbody className="infoTable">
                    {tableInfoComponent}
                    {deleteButtonComponent}
                    {editButtonComponent}
                </tbody>
                {/*
                 */}
            </table>
            {/* <div>{createButtonComponent}</div> */}
        </section>
    );
};

export default Genericpage;
